import React from 'react'
import './App.css';
import IMAGES from './images/imag';
import {Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { Navbar, Nav, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


const Navi = () => {
        const navigate = useNavigate();
      
        const handleSignInClick = () => {
          navigate('/Register');
        };
  return (
    <div>
      <div class="main-container">
            <header id="header">
                <div class="logo">
                    <img src={IMAGES.img1} alt="logo" width="50px" height="70px"/>
                </div>
                <div class="nav-bar">

            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/Features">Features</Link>
                        </li>
                        <li>
                            <Link to="/Explore">Explore</Link>
                        </li>
                    </ul>
                </nav>


            </div>
                <div class="register-login-button">
                    <button class="credentials-button" type="button" onClick={handleSignInClick}>Register</button>
                </div>
                </div>

            </header></div>
        </div>
  )
}

export default Navi;
